import React from 'react';
import Navigation from '../components/Navigation';

function HomePage() {
  return (
    <div className="HomePage" style={Styles.home}>
      <Navigation />
    </div>
  );
}

const Styles = {
  home:{
    height: "100%"
  }
}
export default HomePage;
